    <nav>
      <Link href="/">
        <a id="logo">  	<img src={'http://pngimg.com/uploads/bitcoin/bitcoin_PNG17.png'} alt="Logo" /></a>
      </Link>
      <Link href="/about">
        <a>About</a>
      </Link>

      <Link href="/about">
        <a>White Papers</a>
      </Link>

      <Link href="/about">
