          word-spacing: -2px;

        }

        a:hover {
          color: #777;
        }
        #logo {

        }

        #logo img {
          width: 15%;
          position: absolute;
          left: 5px;
          top: 10px;
          height: 50px;
        }

        button {
          position: absolute;
          right: 50px;
          top: 20px;
          height: 35px;
          width: 125px;
          font-size: 14px;;
        }
        button:hover {
          cursor: pointer;
        }

      `}</style>
  </div>



);

export default Header;
